F# doesn't have while loops or for loops, to iterate we instead use recusion. For example, say we want to get the length of a list. In an imperative language, we might see something like this: fn length<T>(array: &[T]) -> usize { let mut count = 0; for element in array { count += 1; } return count;
} fn main() { let names = ["Josh", "Ben", "Jenna", "Brook"]; let length = length(&names); println!("{length}");
} In F# however, we combine the use of recursion and match statements to accomplish the same thing. let rec length array = match array with | [] -> 0 | head::tail -> 1 + (length tail) let names = ["Josh"; "Ben"; "Jenna"; "Brook"]
let length = length names printfn "%d" length In the example above we define a recursive (rec) function length which takes in a single parameter array. We then match against the value contained in array. []: if array is an empty list, return 0 head::tail: separate the head from the tail and recusively call length again with just the tail, adding 1 to its result

